import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import NavBar from '../Components/navbar';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation
} from "mdbreact";
import "./test.css";

class CSGO extends React.Component {
  state = {
    collapsed: false
  };

  handleTogglerClick = () => {
    this.setState({
      collapsed: !this.state.collapsed
    });
  };

  render() {
    return (
      <div>
      <NavBar/>
      <div id="apppage">
       <MDBView>

        </MDBView>


      </div>
     </div>
    );
  }
}

export default CSGO;
